import React, { Component } from 'react'

import { Table } from 'antd'
const sectionColumns = [
	{
		title: '部门名称',
		dataIndex: 'name',
		key: 'name',
	},
	{
		title: '部门负责人',
		dataIndex: 'leader',
		key: 'leader',
	},
	{
		title: '部门职责',
		dataIndex: 'duty',
		key: 'duty',
	},
	{
		title: '部门人数',
		dataIndex: 'peopleCount',
		key: 'peopleCount',
	},
	{
		title: '部门邮箱',
		dataIndex: 'email',
		key: 'email',
	},
	{
		title: '部门电话',
		dataIndex: 'phone',
		key: 'phone',
	},
]

class SectionCreate extends Component {
	render() {
		return (
			<div className='APP'>
				<Table></Table>
			</div>
		)
	}
}
export default SectionCreate
